        \                                                                               <div
        class=\"landing-text\"><p>\u0412&nbsp;\u0441\u043E\u043E\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u0438
        \u0441\u043E&nbsp;\u0441\u0442\u0430\u0442\u044C\u0435\u0439 12&nbsp;\u0424\u0435\u0434\u0435\u0440\u0430\u043B\u044C\u043D\u043E\u0433\u043E
        \u0437\u0430\u043A\u043E\u043D\u0430 \u043E\u0442&nbsp;02.12.1990 &#8470;&nbsp;<nobr>395-1</nobr>
        &laquo;\u041E&nbsp;\u0431\u0430\u043D\u043A\u0430\u0445 \u0438&nbsp;\u0431\u0430\u043D\u043A\u043E\u0432\u0441\u043A\u043E\u0439
        \u0434\u0435\u044F\u0442\u0435\u043B\u044C\u043D\u043E\u0441\u0442\u0438&raquo;
        \u0411\u0430\u043D\u043A \u0420\u043E\u0441\u0441\u0438\u0438 \u0432\u0435\u0434\u0435\u0442
        \u041A\u043D\u0438\u0433\u0443 \u0433\u043E\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043D\u043D\u043E\u0439
        \u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0430\u0446\u0438\u0438 \u043A\u0440\u0435\u0434\u0438\u0442\u043D\u044B\u0445
        \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u0439 \u0432&nbsp;\u043F\u043E\u0440\u044F\u0434\u043A\u0435,
        \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043B\u0435\u043D\u043D\u043E\u043C
        \u0444\u0435\u0434\u0435\u0440\u0430\u043B\u044C\u043D\u044B\u043C\u0438 \u0437\u0430\u043A\u043E\u043D\u0430\u043C\u0438
        \u0438&nbsp;\u043F\u0440\u0438\u043D\u0438\u043C\u0430\u0435\u043C\u044B\u043C\u0438
        \u0432&nbsp;\u0441\u043E\u043E\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u0438
        \u0441&nbsp;\u043D\u0438\u043C\u0438 \u043D\u043E\u0440\u043C\u0430\u0442\u0438\u0432\u043D\u044B\u043C\u0438
        \u0430\u043A\u0442\u0430\u043C\u0438 \u0411\u0430\u043D\u043A\u0430 \u0420\u043E\u0441\u0441\u0438\u0438.</p>\r\n<p>\u0421\u043F\u0438\u0441\u043E\u043A
        \u043A\u0440\u0435\u0434\u0438\u0442\u043D\u044B\u0445 \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u0439,
        \u0437\u0430\u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0438\u0440\u043E\u0432\u0430\u043D\u043D\u044B\u0445
        \u043D\u0430&nbsp;\u0442\u0435\u0440\u0440\u0438\u0442\u043E\u0440\u0438\u0438
        \u0420\u043E\u0441\u0441\u0438\u0439\u0441\u043A\u043E\u0439 \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438,
        \u0441\u0444\u043E\u0440\u043C\u0438\u0440\u043E\u0432\u0430\u043D \u043D\u0430&nbsp;\u043E\u0441\u043D\u043E\u0432\u0430\u043D\u0438\u0438
        \u041A\u043D\u0438\u0433\u0438 \u0433\u043E\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043D\u043D\u043E\u0439
        \u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0430\u0446\u0438\u0438 \u043A\u0440\u0435\u0434\u0438\u0442\u043D\u044B\u0445
        \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u0439.</p>\r\n<p>\u0412\u0438\u0434&nbsp;\u043A\u0440\u0435\u0434\u0438\u0442\u043D\u043E\u0439
        \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u0438: &laquo;\u041D\u041A\u041E&raquo;&nbsp;&mdash;
        \u043D\u0435\u0431\u0430\u043D\u043A\u043E\u0432\u0441\u043A\u0430\u044F \u043A\u0440\u0435\u0434\u0438\u0442\u043D\u0430\u044F
        \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u044F. \u0412&nbsp;\u0441\u043B\u0443\u0447\u0430\u0435
        \u0435\u0441\u043B\u0438 \u0434\u0430\u043D\u043D\u0430\u044F \u0433\u0440\u0430\u0444\u0430
        \u043D\u0435&nbsp;\u0437\u0430\u043F\u043E\u043B\u043D\u0435\u043D\u0430,
        \u043A\u0440\u0435\u0434\u0438\u0442\u043D\u0430\u044F \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u044F
        \u044F\u0432\u043B\u044F\u0435\u0442\u0441\u044F \u0431\u0430\u043D\u043A\u043E\u043C.</p>\r\n<p>\u041E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u043E\u043D\u043D\u043E-\u043F\u0440\u0430\u0432\u043E\u0432\u0430\u044F
        \u0444\u043E\u0440\u043C\u0430: &laquo;\u041E\u041E\u041E&raquo;&nbsp;&mdash;
        \u043E\u0431\u0449\u0435\u0441\u0442\u0432\u043E \u0441&nbsp;\u043E\u0433\u0440\u0430\u043D\u0438\u0447\u0435\u043D\u043D\u043E\u0439
        \u043E\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0435\u043D\u043D\u043E\u0441\u0442\u044C\u044E,
        &laquo;\u041E\u0410\u041E&nbsp;(\u0410\u041E)&raquo;&nbsp;&mdash; \u043E\u0442\u043A\u0440\u044B\u0442\u043E\u0435
        \u0430\u043A\u0446\u0438\u043E\u043D\u0435\u0440\u043D\u043E\u0435 \u043E\u0431\u0449\u0435\u0441\u0442\u0432\u043E
        (\u0430\u043A\u0446\u0438\u043E\u043D\u0435\u0440\u043D\u043E\u0435 \u043E\u0431\u0449\u0435\u0441\u0442\u0432\u043E),
        &laquo;\u0417\u0410\u041E&nbsp;(\u0410\u041E)&nbsp;&mdash; \u0437\u0430\u043A\u0440\u044B\u0442\u043E\u0435
        \u0430\u043A\u0446\u0438\u043E\u043D\u0435\u0440\u043D\u043E\u0435 \u043E\u0431\u0449\u0435\u0441\u0442\u0432\u043E
        (\u0430\u043A\u0446\u0438\u043E\u043D\u0435\u0440\u043D\u043E\u0435 \u043E\u0431\u0449\u0435\u0441\u0442\u0432\u043E),
        &laquo;\u041F\u0410\u041E&raquo;&nbsp;&mdash; \u043F\u0443\u0431\u043B\u0438\u0447\u043D\u043E\u0435
        \u0430\u043A\u0446\u0438\u043E\u043D\u0435\u0440\u043D\u043E\u0435 \u043E\u0431\u0449\u0435\u0441\u0442\u0432\u043E,
        , &laquo;\u041D\u041F\u0410\u041E&raquo;&nbsp;&mdash; \u043D\u0435\u043F\u0443\u0431\u043B\u0438\u0447\u043D\u043E\u0435
        \u0430\u043A\u0446\u0438\u043E\u043D\u0435\u0440\u043D\u043E\u0435 \u043E\u0431\u0449\u0435\u0441\u0442\u0432\u043E.</p>\r\n<p>\u0421\u0442\u0430\u0442\u0443\u0441
        \u043B\u0438\u0446\u0435\u043D\u0437\u0438\u0438: &laquo;\u041E\u0422\u0417&raquo;&nbsp;&mdash;
        \u043B\u0438\u0446\u0435\u043D\u0437\u0438\u044F \u043E\u0442\u043E\u0437\u0432\u0430\u043D\u0430,
        &laquo;\u0410\u041D\u041D&raquo;&nbsp;&mdash; \u043B\u0438\u0446\u0435\u043D\u0437\u0438\u044F
        \u0430\u043D\u043D\u0443\u043B\u0438\u0440\u043E\u0432\u0430\u043D\u0430,
        &laquo;\u0420\u0415\u0413&raquo;&nbsp;&mdash; \u043A\u0440\u0435\u0434\u0438\u0442\u043D\u0430\u044F
        \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u044F \u0435\u0449\u0451&nbsp;\u043D\u0435&nbsp;\u043E\u043F\u043B\u0430\u0442\u0438\u043B\u0430
        \u0443\u0441\u0442\u0430\u0432\u043D\u044B\u0439 \u043A\u0430\u043F\u0438\u0442\u0430\u043B
        \u0438&nbsp;\u043D\u0435&nbsp;\u043F\u043E\u043B\u0443\u0447\u0438\u043B\u0430
        \u043B\u0438\u0446\u0435\u043D\u0437\u0438\u044E (\u0432&nbsp;\u0440\u0430\u043C\u043A\u0430\u0445
        \u0437\u0430\u043A\u043E\u043D\u043E\u0434\u0430\u0442\u0435\u043B\u044C\u043D\u043E
        \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043B\u0435\u043D\u043D\u043E\u0433\u043E
        \u0441\u0440\u043E\u043A\u0430). \u0412&nbsp;\u0441\u043B\u0443\u0447\u0430\u0435
        \u0435\u0441\u043B\u0438 \u0434\u0430\u043D\u043D\u0430\u044F \u0433\u0440\u0430\u0444\u0430
        \u043D\u0435&nbsp;\u0437\u0430\u043F\u043E\u043B\u043D\u0435\u043D\u0430,
        \u043A\u0440\u0435\u0434\u0438\u0442\u043D\u0430\u044F \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u044F
        \u044F\u0432\u043B\u044F\u0435\u0442\u0441\u044F \u0434\u0435\u0439\u0441\u0442\u0432\u0443\u044E\u0449\u0435\u0439.
        \u041F\u0435\u0440\u0435\u0447\u0435\u043D\u044C \u0432\u044B\u0434\u0430\u043D\u043D\u044B\u0445
        \u043B\u0438\u0446\u0435\u043D\u0437\u0438\u0439 \u043D\u0430&nbsp;\u043E\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043B\u0435\u043D\u0438\u0435
        \u0431\u0430\u043D\u043A\u043E\u0432\u0441\u043A\u0438\u0445 \u043E\u043F\u0435\u0440\u0430\u0446\u0438\u0439
        \u0441\u043E\u0434\u0435\u0440\u0436\u0438\u0442\u0441\u044F \u0432&nbsp;\u043F\u043E\u0434\u0440\u043E\u0431\u043D\u044B\u0445
        \u0441\u0432\u0435\u0434\u0435\u043D\u0438\u044F\u0445 \u043F\u043E&nbsp;\u0441\u043E\u043E\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0443\u044E\u0449\u0435\u0439
        \u043A\u0440\u0435\u0434\u0438\u0442\u043D\u043E\u0439 \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u0438.</p></div>\r\n\r\n<script
